    const [selectedYear,setSelectedYear] = useState(2024)
    const handleClick = (index) =>  setSelectedYear(index);

    return (
        <>
        <Banner aniWidth={"50%"} />
        <YearSearchBox handleClick={handleClick} SelectedYear={selectedYear} />
        </>
    )
}
